import { Text } from "react-native";
import Icon from "react-native-vector-icons/Ionicons";

function ExampleView(props) {
  return (
    <Icon
      style={{
        alignItems: "center",
      }}
      name="location-sharp"
      color="black"
      size={24}
    />
  );
}
export default ExampleView;
